import "./MoviePage.css";
import axios from 'axios';
import React, {useEffect} from 'react';

const MoviePage = (props) => {
    const getHandler = async (id) =>{
        try{
        axios.get('https://www.omdbapi.com/?i=' + id + '&apikey=bf994a28')
        .then(res => {
            console.log(res);
        })
        .catch(err => {
            console.log(err);
          })
        } catch (error){
            console.log('fail');
        }
    }

    useEffect(() => {
        getHandler();
    },[])

  return (
    <div>
      <h1>{props.id}</h1>
    </div>
  );
};

export default MoviePage;
